import React, { Component, Fragment } from 'react'
import './App.css'
import Membre from './components/Membre'

class App extends Component {
  render () {
    return (
      <div className="App">
        <h1>{ this.props.titre }</h1>
        <Membre name='Alex'/>
        <Membre name='Caroline'/>
        <Membre name='Louane'/>
        <Membre name='Lucky'>
          <h3>Je suis un chien.</h3>
        </Membre>
      </div>
    )
  }
}

export default App;
